self.addEventListener("activate", function (event) {
    event.waitUntil(
      // Get all cache names
      self.caches.keys().then(function (cacheNames) {
        // Use Promise.all to wait for all caches to be deleted
        return Promise.all(
          // Filter cache names (you can add conditions here)
          cacheNames
            .filter(function (cacheName) {
              return true; // You can add conditions to decide which caches to delete
            })
            // Delete each cache
            .map(function (cacheName) {
              return self.caches.delete(cacheName);
            })
        );
      })
    );
  });
